Lego Marvel X-Men X-Jet 76281
LEGO® Marvel X-Men X-Jet (76281), havalı uçakların, inşa edilebilen LEGO Marvel oyuncaklarının ve Marvel Studios’un TV dizisi X-Men ’97’nin hayranları için mükemmel bir nakliye aracıdır. 8 yaş ve üzeri çocuklara hediye etmek için popüler LEGO Marvel yapım oyuncakları arıyorsanız X-Men X-Jet inşa edilebilen oyuncak uçak, süper kahraman statülerini yeni boyutlara çıkarmak için mükemmeldir. X-Men ’97’deki X-Jet’e dayalı bu olağanüstü model uçak yapım seti; Cyclops, Rogue, Magneto ve Wolverine minifigürleriyle havada sınırsız maceralara ilham verir. İnşa edilebilen aksiyon oyuncağında 4 minifigürlük yeri olan ikiz kokpit, uçağın her iki tarafında 2 mermi atıcı ve kanatların altında 2 yaylı atıcı bulunur. İnşa edilebilen model uçak, ayrıca çocukların yedek mermileri ve minifigüre takılı olmadığında Wolverine’in uzun pençelerini koyabilecekleri 2 adet çıkarılabilir kutuya sahiptir. Ekstra dijital eğlence için model severler eğlenceli ve sezgisel LEGO Builder uygulamasını kullanarak modelleri 3 boyutlu yakınlaştırabilir, döndürebilir ve ilerlemelerini takip edebilir.;

X-Men X-Jet – X-Men model uçak oyun ve sergileme setiyle çocukları Marvel Studios X-Men ’97 TV dizisinden X-Jet’e bindirin;
4 minifigür – İnşa edilebilen oyuncak uçağın kokpitinde, tanıdık X-Men karakterleri Wolverine, Cyclops, Rogue ve Magneto için yer vardır;
İnşa edilebilen X-Men oyuncak uçağı – X-Jet’in iki tarafında 2 mermi atıcı, altında 2 yaylı atıcı ve içinde çocukların mermileri ve Wolverine’in takılabilir pençelerini koyabilecekleri çıkarılabilir 2 adet kutu bulunur;
İnşa edilebilen oyna-sergile model uçak – Günün süper kahraman aksiyonu bittiğinde, X-Men X-Jet herkesin görüp beğenmesi için sergilenebilir;
Film severler için LEGO® hediyesi – Bu inşa edilebilen uçak, jet uçaklarının ve Marvel filmlerinin hayranları için hediye fikridir;
3D yapım talimatları – Çocuklar, sürükleyici bir yapım deneyimi için modelleri 3 boyutlu yakınlaştırıp döndürmelerine, setleri kaydetmelerine ve ilerlemeyi takip etmelerine olanak tanıyan dijital araçlarıyla LEGO® Builder uygulamasını indirebilir;
LEGO® Marvel serisi – Geniş LEGO Marvel yapım oyuncakları koleksiyonu, tüm genç süper kahramanları uygulamalı, yaratıcı maceralara teşvik etmek için tasarlanmıştır;
359 parçalı yapım seti – Bu inşa edilebilen model jet uçağın yüksekliği 8 cm, uzunluğu 30 cm, genişliği 25 cm’dir;

